import React from "react";
import cricketimage from "../../assets/cricket.jpg";

const Cricket = () => {
  return (
    <div className="min-h-screen">
      <div>
        <img src={cricketimage} alt="" />
      </div>
      <div>
        <div>
        <svg
          xmlns="http://www.w3.org/2000/svg"
          class="h-6 w-6"
          fill="none"
          viewBox="0 0 24 24"
          stroke="currentColor"
          stroke-width="2"
        >
          <path
            stroke-linecap="round"
            stroke-linejoin="round"
            d="M11 4a7 7 0 100 14 7 7 0 000-14zm0 0l7 7"
          />
        </svg>
        
        </div>

      </div>
    </div>
  );
};

export default Cricket;
